import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { Link } from 'react-router-dom';
import { Home } from "./components/Home"
import { Films } from "./components/Films"

export default class App extends React.Component {
  constructor(props) {
    super(props)
    this.state = { 
        isClacked: false
     }
  }

  render() {
    return (
      <Router>
          <div className="container">
          <nav>
    <Link to="/">Home</Link>
    <Link to="/films">Dashboard</Link>
          </nav>
          <Route
              path="/"
              component={Home}
              exact 
          />
          <Route
              path="/films"
              component={Films} 
          />
          <Route
              path="/people"
              component={People} 
          />
          <Route
              path="/planets"
              component={Planets} 
          />
          <Route
              path="/species"
              component={Species} 
          />
          <Route
              path="/starships"
              component={Starships} 
          />
          <Route
              path="/vehicles"
              component={Vehicles} 
          />
      </div>
    </Router>
    );
  }
}

ReactDOM.render(
  <App/>,
  document.getElementById('root')
);
